  function OnOpenExpandAccordian() {
    /* var pageURL = window.location.href; // Code to get the current page's full URL including the id - '#'*/
    let selectorFromPageID = window.location.hash;
    selectorFromPageID = selectorFromPageID.split("$$$")[0];
    if (!selectorFromPageID) {
      return;
    }
    const selectedElement = $(selectorFromPageID);
    const accordianTitleDivSelector =
      selectedElement.closest(".accordian_item");
    let selectedElementsParents = selectedElement.parents(".accordian_item");
    if (selectedElementsParents.length > 1) {
      $(selectedElementsParents.last().children()[0]).removeClass("collapsed");
      $(selectedElementsParents.last().children()[1]).addClass("show");
    }
    selectedElement
      .parent()
      .find(".accordian_item_wrapper")
      .removeClass("collapsed");
    selectedElement.addClass("show");
    let selectedItemcontent = selectedElement.parents(
      ".accordian_item_content"
    );
    if (selectedItemcontent.length >= 1) {
      $(selectedItemcontent.parent(".collapse")).addClass("show");
      selectedElement
        .parents(".accordian_item")
        .find(".accordian_item_wrapper")
        .removeClass("collapsed");
    }
    openAccordian(accordianTitleDivSelector, true);
  }

