  // New for Open Accordian click

  function openAccordian(obj, isreload) {
    const currentlyClickedElement = obj;
    if (
      $($(currentlyClickedElement).children()[0]).hasClass("collapsed") ||
      isreload
    ) {
      /*Checking for single-expansion-accordian *by checking reverse of "multi_expansion_accordian".*/
      const parentOfCurrentElement = $(obj).parent();
      const isMultiExpansionAccordian = $(parentOfCurrentElement).hasClass(
        "multi_expansion_accordian"
      );
      if (!isMultiExpansionAccordian) {
        const childrenOfParentElement = parentOfCurrentElement.children();
        const offsetOfFirstElement =
          childrenOfParentElement.length &&
          childrenOfParentElement[0].offsetTop;
        /* Checking if all the accordian_items in the accordian_list are at the same height, i.e. row based accordian*/
        let areAllChildrenAtSameOffset = true;
        childrenOfParentElement.length &&
          childrenOfParentElement.each(function (currentIndex, currentElement) {
            if (currentElement.offsetTop !== offsetOfFirstElement)
              areAllChildrenAtSameOffset = false;
          });
        if (childrenOfParentElement.length > 1) {
          $(childrenOfParentElement).each(function (index, element) {
            if (
              element === currentlyClickedElement ||
              element === currentlyClickedElement[0]
            ) {
              if (index === 0) {
                const offsetTopValue = $(element).offset().top - heightOfHeader;
                vScrollTo(offsetTopValue);
              } else {
                if (!areAllChildrenAtSameOffset) {
                  /* Scrolling calculation if all the siblings have different offset, i.e. if all the siblings are stacked instead of side-by-side as in a flex container.*/
                  const offsetTopValue =
                    $(childrenOfParentElement[0]).offset().top +
                    78 * index -
                    heightOfHeader;
                  vScrollTo(offsetTopValue);
                } else {
                  const offsetTopValue =
                    $(childrenOfParentElement[index - 1]).offset().top -
                    heightOfHeader;
                  vScrollTo(offsetTopValue);
                }
              }
            }
          });
        } else {
          const offsetTopValue = $(obj).length
            ? $(obj).offset().top - heightOfHeader
            : 0;
          vScrollTo(offsetTopValue);
        }
      } else {
        /* Scrolling calculation for multi_expansion_accordian*/
        const offsetTopValue =
          $(currentlyClickedElement).offset().top - heightOfHeader;
        vScrollTo(offsetTopValue);
      }
    }
  }

