$(document).ready(function(){
    $('.typePhn').on("change keyup paste", function (e) {
        var output,
        $this = $(this),
        input = $this.val();
        var minLength = $(this).attr("min-length");
        if (e.keyCode != 8) {
            input = input.replace(/[^0-9]/g, '');
            if (input.length == 11) {
				$('.phone-number_errormsg').remove("");
                $('.phone-validation').css("border", "1px solid #00b451");
            }
            var area = input.substr(0, 3);
            var pre = input.substr(3, 3);
            var tel = input.substr(6, 4);
            if (input.length > 0) {
                if (area.length < 3) {
                    output = "(" + area;
                } else if (area.length == 3 && pre.length < 3) {
                output = "(" + area + ")" + " " + pre;
                } else if (area.length == 3 && pre.length == 3) {
                output = "(" + area + ")" + " " + pre + "-" + tel;
                }
                $this.val(output);
            } else {
            $this.val(input);
            }
        }
    });
    $('.typePhn').on("focusin", function (e) {
        $('.phone-number_errormsg').remove("");
        $(".formContainer .form-button").prop("disabled", false);
        $('.phone-validation').css("border", "1px solid #00b451");
   });
    $('.typePhn').on("focusout", function (e) {
        var output,
        $this = $(this),
        input = $this.val();
        var minLength = $(this).attr("min-length");
        if (e.keyCode != 8) {
            input = input.replace(/[^0-9]/g, '');
            if (input.length == 11) {
				$('.phone-number_errormsg').remove("");
                $(".formContainer .form-button").prop("disabled", false);
                $('.phone-validation').css("border", "1px solid #00b451");
            }
            var area = input.substr(0, 3);
            var pre = input.substr(3, 3);
            var tel = input.substr(6, 4);
            if (input.length > 0) {
                if (area.length < 3) {
                    output = "(" + area;
                } else if (area.length == 3 && pre.length < 3) {
                output = "(" + area + ")" + " " + pre;
                } else if (area.length == 3 && pre.length == 3) {
                output = "(" + area + ")" + " " + pre + "-" + tel;
                }
                $this.val(output);
                if (minLength > output.length) {
                    console.log(`Min Length should be ${minLength}`);
                    $('.phone-validation').css("border", "1px solid #e31c3d");
                    $('.phone-number_errormsg').remove("");
                    $(this).parent().append('<span class="phone-number_errormsg" role="alert" id="error-name"></span>');
                    // $(".phone-number_errormsg").parent().css({ "margin-bottom": "40px" });
                    $('.phone-number_errormsg').html(`Minimum Length should be ${minLength}`).css("color", "#e31c3d");
                    // $(".formContainer .form-button").prop("disabled", true);
                    $('.phone-validation-input .floating-label').css('color', '#E31C3D');
                    $("#gf-modal-submit-btn").prop("disabled", true);
                }else{

                    $('.phone-number_errormsg').remove("");
                    $(".formContainer .form-button").prop("disabled", false);

                    }
            } else {
            $this.val(input);
                $(".phone-number_errormsg").parent().css({ "margin-bottom": "20px" });
                $('.phone-number_errormsg').remove("");
                $(".formContainer .form-button").prop("disabled", false);
                $('.phone-validation').css("border", "1px solid #00b451");
            }
        }else {
            if (input.length > 0) {
             $('.phone-validation').css("border", "1px solid #e31c3d");
             $('.phone-number_errormsg').remove("");
             $(this).parent().append('<span class="phone-number_errormsg" role="alert" id="error-name"></span>');
             $(".phone-number_errormsg").parent().css({ "margin-bottom": "40px" });
             $('.phone-number_errormsg').html(`Min Length should be ${minLength}`).css("color", "#e31c3d");
             $(".formContainer .form-button").prop("disabled", true);
             $('.phone-validation-input .floating-label').css('color', '#E31C3D');
             $("#gf-modal-submit-btn").prop("disabled", true);
            }
        }
    });
})
